import React from 'react'
import Ddata from './Ddata'

const Dcard = () => {
  return (
    <>
    <div className="content grid product">
        {
            Ddata.map((value,index) => {
                return (
                    <div className="box" key={index}>
                        <div className="img">
                            <img src={value.cover} alt="" />
                        </div>
                        <h4>{value.name}</h4>
                        
                    </div>
                )
            })
        }
    </div>
    </>
  )
}

export default Dcard
